or websites.  \n   Publicly sharing your own or others\u2019 login information on platform or through a third party service.  \n   Creating, sharing, or hosting malicious software or malicious browser extensions to compromise accounts or gain access to user data. \n   Providing online infrastructure, including Web Hosting Services, Domain Name System servers, and ad networks that enables abusive links such that a majority of those links on Facebook or Instagram violate the Spam or Cybersecurity sections of the Community Standards.  \n      \n          \n\n    \n  \n ","policy_rationale":"\n   We recognize that the safety of our users extends to the security of their personal information. Attempts to gather sensitive personal information by deceptive or invasive methods are harmful to the authentic, open, and safe atmosphere that we want to foster. Therefore, we do not allow attempts to gather sensitive user information through the abuse of our platform and products.\n \n "},"inauthentic_behavior":{"other_content":"\n   \n  \n    Do not: \n    \n      \n      \n        Use multiple Facebook accounts or share accounts between multiple people \n        Misuse Facebook or Instagram reporting systems to harass others \n        Conceal a Page\u2019s purpose by misleading users about the ownership or control of that Page \n        Engage in or claim to engage in Inauthentic Behavior, which is defined as the use of Facebook or Instagram assets (accounts, pages, groups, or events), to mislead people or Facebook: \n       \t \n           about the identity, purpose, or origin of the entity that they represent  \n           about the popularity of Facebook or Instagram content or assets \n           about the purpose of an audience or community \n           about the source or origin of content \n           to evade enforcement under our Community Standards \n         \n        \n        Engage in, or claim to engage in Coordinated Inauthentic Behavior, defined as the use of multiple Facebook or Instagram assets, working in concert to engage in Inauthentic Behavior (as defined above), where the use of fake accounts is central to the operation \n        Engage in or claim to engage in Foreign or Government Interference, which is Coordinated Inauthentic Behavior conducted on behalf of a foreign or government actor. \n      \n      \n    \n  \n ","policy_rationale":"\n   In line with our commitment to authenticity, we don't allow people to misrepresent themselves on Facebook, use fake accounts, artificially boost the popularity of content, or engage in behaviors designed to enable other violations under our Community Standards. This policy is intended to create a space where people can trust the people and communities they interact with. \n "},"false_news":{"other_content":"\n   \n  \n    We are working to build a more informed community and reduce the spread of false news in a number of different ways, namely by \n    \n     \t \n         Disrupting economic incentives for people, Pages, and domains that propagate misinformation  \n         Using various signals, including feedback from our community, to inform a machine learning model that predicts which stories may be false \n         Reducing the distribution of content rated as false by independent third-party fact-checkers \n         Empowering people to decide for themselves what to read, trust, and share by informing them with more context and promoting news literacy \n         Collaborating with academics and other organizations to help solve this challenging issue \n       \n    \n  \n ","policy_rationale":"\n   Reducing the spread of false news on Facebook is a responsibility that we take seriously. We also recognize that this is a challenging and sensitive issue. We want to help people stay informed without stifling productive public discourse. There is also a fine line between false news and satire or opinion. For these reasons, we don't remove false news from Facebook but instead, significantly reduce its distribution by showing it lower in the News Feed. Learn more about our work to reduce the spread of false news  here . \n "},"manipulated_media":{"other_content":"\n   \n \n    Do not post: \n    \n     \t \n         Video\n         \n         that has been edited or synthesized, beyond adjustments for clarity or quality, in ways that are not apparent to an average person, and would likely mislead an average person to believe that a subject of the video said words that they did not say AND \n           is the product of artificial intelligence or machine learning, including deep learning techniques (e.g., a technical deepfake), that merges, combines, replaces, and\/or superimposes content onto a video, creating a video that appears authentic. \n      \n           This policy does not extend to content that is parody or satire or is edited to omit words that were said or change the order of words that were said.\n        \n    \n  \n ","policy_rationale":"\n   Media, including image, audio, or video, can be edited in a variety of ways. In many cases, these changes are benign, like a filter effect on a photo. In other cases, the manipulation isn\u2019t apparent and could mislead, particularly in the case of video content. We aim to remove this category of manipulated media when the criteria laid out below have been met. \n     In addition, we will continue to invest in partnerships (including with journalists, academics and independent fact-checkers) to help us reduce the distribution of false news and misinformation, as well as to better inform people about the content they encounter online.  \n \n "},"memorialization":{"other_content":"\n   \n  \n    For victims of murder and suicide we will remove the following content if it appears on the deceased\u2019s profile photo, cover photo, or among recent timeline posts when requested by a legacy contact or family member of the deceased: \n\n\n     \n      \n          \n      Visual depiction of the object used in the deceased\u2019s death \n      Imagery of the convicted or alleged murderer of the deceased \n             Content related to the deceased\u2019s death \n       \n      \nFor victims of murder, we will also remove the convicted or alleged murderer from the deceased\u2019s profile if referenced in relationship status or among friends. \n       When we have additional context provided by the legacy contact or a family member of the deceased, we may:\n \n      \n       Remove bullying or harassment violations on a memorialized profile, which normally require the individual to self-report \n\n   Remove praise or support for the death, disease, or harm of the deceased person on a memorialized profile \n\n\n   Change the deceased\u2019s individual\u2019s privacy settings from public to friends-only when there is harmful content on the profile  \n\n   Change a violating account name on the profile of the deceased individual \n \n     \n         \n    \n ","policy_rationale":"\n   When someone passes away, friends and family can request that we  memorialize  the Facebook account. Once memorialized, the word \"Remembering\" appears above the name on the person's profile to help make it that the account is now a memorial site and protects against attempted logins and fraudulent activity. To respect the choices someone made while  alive, we aim to preserve their account after they pass away. We have also made it possible for people to identify a  legacy contact  to look after their account after they pass away. To support the bereaved, in some instances we may remove or change certain content when the legacy contact or family members request it.\n     Visit  Hard Questions  for more information about our memorialization policy and process. And see our  Newsroom  for the latest tools we're building to support people during these difficult times. \n "},"intellectual_property":{"other_content":"\n   \n  \n    Upon receipt of a report from a rights holder or an authorized representative, we will remove or restrict content that engages in: \n    \n \n   Copyright infringement    \n   Trademark infringement \n \n    \n  \n ","policy_rationale":"\n   Facebook takes  intellectual property rights  seriously and believes they are important to promoting expression, creativity, and innovation in our community. You own all of the content and information you post on Facebook, and you control how it is shared through your privacy and application settings. However, before sharing content on Facebook, please be sure you have the right to do so. We ask that you respect other people\u2019s copyrights, trademarks, and other legal rights. We are committed to helping people and organizations promote and protect their intellectual property rights. Facebook\u2019s  Terms of Service  do not allow people to post content that violates someone else\u2019s intellectual property rights, including copyright and trademark. We publish information about the intellectual property reports we receive in our bi-annual Transparency Report, which can be accessed at  https:\/\/transparency.facebook.com\/ \n "},"user_requests":{"other_content":"\n  \n    We comply with: \n \n   \n     User requests for removal of their own account \n     Requests for removal of a deceased user\u2019s account from a verified immediate family member or executor \n     Requests for removal of an incapacitated user\u2019s account from an authorized representative \n     \n    \n  \n ","policy_rationale":null},"additional_protection_minors":{"other_content":"\n  \n    We comply with: \n \n     Requests for removal of an underage account \n     Government requests for removal of child abuse imagery depicting, for example, beating by an adult or strangling or suffocating by an adult \n     Legal guardian requests for removal of attacks on unintentionally famous minors \n   \n  \n ","policy_rationale":null},"stakeholder_engagement":{"other_content":null,"policy_rationale":null}},"rawIntroContent":"\n   \n     Every day, people use Facebook to share their experiences, connect with friends and family, and build communities. We are a service for more than two billion people to freely express themselves across countries and cultures and in dozens of languages. \n     We recognize how important it is for Facebook to be a place where people feel empowered to communicate, and we take seriously our role in keeping abuse off our service. That\u2019s why we\u2019ve  developed a set of Community Standards  that outline what is and is not allowed on Facebook. Our policies are based on feedback from our community and the advice of experts in fields such as technology, public safety and human rights. To ensure that everyone\u2019s voice is valued, we take great care to craft policies that are inclusive of different views and beliefs, in particular those of people and communities that might otherwise be overlooked or marginalized. \n   \n         \n     REITERATING OUR COMMITMENT TO VOICE \n     The goal of our Community Standards has always been to  create a place for expression and give people a voice . This has not and will not change. Building community and bringing the world closer together depends on people\u2019s ability to share diverse views, experiences, ideas and information. We want people to be able to talk openly about the issues that matter to them, even if some may disagree or find them objectionable. In some cases, we allow content which would otherwise go against our Community Standards \u2013 if it is newsworthy and in the public interest. We do this only after weighing the public interest value against the risk of harm and we look to international human rights standards to make these judgments.  \n    \n     Our commitment to expression is paramount, but we recognize the internet creates new and increased opportunities for abuse. For these reasons, when we limit expression, we do it in service of one or more the following values: \n   \n       \n\n     Authenticity:  We want to make sure the content people are seeing on Facebook is authentic. We believe that authenticity creates a better environment for sharing, and that\u2019s why we don\u2019t want people using Facebook to misrepresent who they are or what they\u2019re doing.\n \n    \n    \n      \n    \n     Safety:  We are committed to making Facebook a safe place. Expression that threatens people has the potential to intimidate, exclude or silence others and isn\u2019t allowed on Facebook. \n  \n    \n  \n    \n    \n     Privacy:  We are committed to protecting personal privacy and information. Privacy gives people the freedom to be themselves, and to choose how and when to share on Facebook and to connect more easily.\n \n        \n  \n    \n     Dignity:  We believe that all people are equal in dignity and rights. We expect that people will respect the dignity of others and not harass or degrade others. \n    \n\n\n    \n    \n     Our Community Standards apply to everyone, all around the world, and to all types of content. They\u2019re designed to be comprehensive \u2013 for example, content that might not be considered hateful may still be removed for violating a different policy. We recognize that words mean different things or affect people differently depending on their local community, language, or background. We work hard to account for these nuances while also applying our policies consistently and fairly to people and their expression. In the case of certain policies, we require more information and\/or context to enforce in line with our Community Standards. \n\n     People can report potentially violating content, including Pages, Groups, Profiles, individual content, and comments. We also give people control over their own experience by allowing them to\n       block ,   unfollow \n       or \n        hide  people and posts.\n       \n\n     The consequences for violating our Community Standards vary depending on the severity of the violation and the person's history on the platform. For instance, we may warn someone for a first violation, but if they continue to violate our policies, we may restrict their ability to post on Facebook or disable their profile. We also may notify law enforcement when we believe there is a genuine risk of physical harm or a direct threat to public safety. \n     Our Community Standards are a guide for what is and isn\u2019t allowed on Facebook. It is in this spirit that we ask members of the Facebook community to follow these guidelines. \n     \nPlease note that the English version of the Community Standards reflects the most up to date set of the policies and should be used as the master document. \n   \n "},"dummyElem":{"__m":"__elem_fc9f538f_0_0"},"acrossTransitions":false,"clobberSiblings":false,"preloader":null,"bigPipeContext":{"__bigPipeContext":1},"lid":"6841352972802805047-0","nonBlockingPreloaders":null,"moduleID":"CommunityStandardsRoot.react","tracePolicy":null}]],["Animation"],["VideosRenderingInstrumentation","storeRenderTime",["__elem_a648e52c_0_0"],[{"__m":"__elem_a648e52c_0_0"}]],["__inst_a648e52c_0_0"],["VideoDisplayTimePlayButton","register",["__elem_8937e029_0_0","__elem_0bcc40a7_0_0"],[{"__m":"__elem_8937e029_0_0"},{"__m":"__elem_0bcc40a7_0_0"}]],["__inst_3f1e98e4_0_0"],["__inst_0bcc40a7_0_0"],["__inst_ebb64f7c_0_0"],["__inst_98d9a45e_0_0"],["__inst_21a8c1d4_0_0"],["__inst_dbb8a0b1_0_0"],["__inst_74f26af1_0_0"],["__inst_6d29ee41_0_0"],["__inst_70dbca80_0_0"],["VideoDashPrefetchCache","loadVideo",[],[{"videoID":1415167278571737,"manifest":[],"video":[{"url":"https:\/\/video-lax3-2.xx.fbcdn.net\/v\/t42.1790-2\/18824400_1415174128571052_5055827053203423232_n.mp4?_nc_cat=106&_nc_sid=5aebc0&efg=eyJ2ZW5jb2RlX3RhZyI6ImRhc2hfdjNfMTI4MF9jcmZfMjNfaGlnaF8zLjFfZnJhZ18yX3ZpZGVvIn0\u00253D&_nc_ohc=JEmUHAMjAbwAX8p2OPI&_nc_ht=video-lax3-2.xx&oh=235674a8463f0bcaee6ee38b3b922c5e&oe=5EF18036","start":0,"end":956,"segment_type":null,"mime_codec":null,
